const ptSansBase64 = '';

async function generateSubgroupsPDF(cards, group) {
    const { jsPDF } = window.jspdf;
    const pdf = new jsPDF({
        orientation: 'portrait',
        unit: 'mm',
        format: 'a4',
        putOnlyUsedFonts: true,
        compress: true
    });

    function addBackground(pdf) {
        pdf.setFillColor(17, 24, 39);
        pdf.rect(0, 0, pdf.internal.pageSize.width, pdf.internal.pageSize.height, 'F');
    }

    const institute = document.getElementById('institute-select').value.replace(/ /g, '_');
    const scheduleUrl = `${window.location.origin}/rasp?institute=${institute}&group=${group}`;

    const pageWidth = pdf.internal.pageSize.width;
    const pageHeight = pdf.internal.pageSize.height;
    const margin = 10;
    const headerHeight = 40;
    const footerHeight = 15;
    const spacing = 5;

    const tempContainer = document.createElement('div');
    tempContainer.style.position = 'absolute';
    tempContainer.style.left = '-9999px';
    tempContainer.style.width = '1920px';
    document.body.appendChild(tempContainer);

    let currentY = headerHeight + margin;
    let currentPage = 1;

    addBackground(pdf);
    
    pdf.addFileToVFS('PTSans-normal.ttf', ptSansBase64);
    pdf.addFont('PTSans-normal.ttf', 'PTSans', 'normal');
    pdf.setFont('PTSans');
    
    function addBackground(pdf) {
        pdf.setFillColor(17, 24, 39);
        pdf.rect(0, 0, pdf.internal.pageSize.width, pdf.internal.pageSize.height, 'F');
    }

    pdf.setTextColor(255, 255, 255);
    pdf.setFontSize(20);
    pdf.text((`Распределение подгрупп ${group}`), margin, 20);
    pdf.setFontSize(12);
    pdf.setTextColor(156, 163, 175);
    pdf.text(('Сгенерировано с помощью ystuRASP'), margin, 30);
    pdf.setTextColor(66, 153, 225);
    pdf.text((`Актуальное расписание: ${scheduleUrl}`), margin, 37);

    for (let i = 0; i < cards.length; i++) {
        const cardClone = cards[i].cloneNode(true);
        cardClone.style.width = '800px';
        tempContainer.appendChild(cardClone);

        const canvas = await html2canvas(cardClone, {
            backgroundColor: '#111827',
            scale: 2,
            logging: false,
            useCORS: true,
            allowTaint: true,
            width: 800,
            height: Math.floor(800 * (cardClone.offsetHeight / cardClone.offsetWidth))
        });

        tempContainer.removeChild(cardClone);

        const cardWidth = pageWidth - (2 * margin);
        const cardHeight = (canvas.height * cardWidth) / canvas.width;

        if (currentY + cardHeight > pageHeight - footerHeight) {
            pdf.setFontSize(8);
            pdf.setTextColor(156, 163, 175);
            const today = new Date();
            const date = today.toLocaleDateString('ru-RU');
            const time = today.toLocaleTimeString('ru-RU', {
                hour: '2-digit',
                minute: '2-digit'
            });
            pdf.text((`Создано: ${date} ${time}. Рекоммендуем использовать актуальную версию на сайте`), margin, pageHeight - margin);

            pdf.addPage();
            addBackground(pdf);
            currentPage++;
            currentY = margin;
        }

        const imgData = canvas.toDataURL('image/png');
        pdf.addImage(
            imgData,
            'PNG',
            margin,
            currentY,
            cardWidth,
            cardHeight,
            undefined,
            'FAST'
        );

        currentY += cardHeight + spacing;
    }

    pdf.setFontSize(8);
    pdf.setTextColor(156, 163, 175);
    const today = new Date();
    const date = today.toLocaleDateString('ru-RU');
    const time = today.toLocaleTimeString('ru-RU', {
        hour: '2-digit',
        minute: '2-digit'
    });
    pdf.text((`Создано: ${date} ${time}. Рекоммендуем использовать актуальную версию на сайте`), margin, pageHeight - margin);

    document.body.removeChild(tempContainer);

    return pdf;
}

async function shareSubgroupsPDF(cards, group, forceDownload = false) {
    const pdf = await generateSubgroupsPDF(cards, group);
    const pdfBlob = pdf.output('blob');
    const file = new File([pdfBlob], `Подгруппы ${group}.pdf`, { type: 'application/pdf' });

    if (forceDownload || !navigator.share) {
        downloadPDF(pdf, group);
        return;
    }

    try {
        await navigator.share({
            files: [file],
            title: `Распределение подгрупп ${group}`,
            text: 'Распределение подгрупп для лабораторных работ'
        });
    } catch (error) {
        if (error.name !== 'AbortError') {
            downloadPDF(pdf, group);
        }
    }
}

function downloadPDF(pdf, group) {
    pdf.save(`Подгруппы ${group}.pdf`);
}

export { shareSubgroupsPDF }; 
